import React from "react";

const TeamPage = () => {
  return (
    <section id="teampage-content">
      <h3>Team Page</h3>
      <div className="team-container">
        <div className="team-member">
          <img src="images/venkat.jpeg" alt="Sai Venkat Kumar Gunnapaneni" className="team-photo" />
          <h4>Sai Venkat Kumar Gunnapaneni</h4>
          <p>Website Developer</p>
          <p>As a Master's student in Computer Science...</p>
        </div>
        {/* Add other team members */}
      </div>
    </section>
  );
};

export default TeamPage;
